1:{s:10:"short_code";s:11:"CEu_-UbAH81";}i:132;a:1:{s:12:"created_time";i:1599264907;}i:133;a:1:{s:7:"caption";s:1614:"Why she gotta sit like a person??? Anyways, proud to announce that this little shit has graduated from in training, to a "fully trained" Service Dog. I've had her since 12 weeks, and now at over a year and a half in to our relationship we've come farther than I imagined. At multiple points, I thought she'd wash. Once because she had no work drive, and I'd actively looked to re-home her before all of a sudden she kicked her own ass in gear and showed me what she was capable of. There's been multiple occasions where she was attacked by dogs, and I didn't think she would bounce back. She did. Better than ever before, after a lot of hard work. She was fear reactive to carts and people in boots and hats and head scarves for the longest time, as well. But damn...

Now, she's exceeded my expectations of where she'd be at by this age. I told myself I wouldn't even consider her fully trained until she was at least 3, but she's fucking earned it! She "graduates" knowing 7 tasks relating to me specifically, over 54 commands in a mix of German, English, and hand signs, and she continues to surprise me with her natural alerts. She has a natural cardiac alert to my fiancé, as well as a low blood sugar alert. 

I never would've imagined this would be my dog, but oh boy am I proud of her and ever so lucky. She's my partner in crime, and I know that with her I can do anything. We've got each other's back in this messed up world.

